import React, { Component } from 'react';
import Iframe from 'react-iframe';
import './App.css';
import List from './List';
import zep from './zep.png'

class App extends Component {
  render() {
    return (
      <div>
        <img url={zep}
        style={{width:"1200px" ,height:"298px", paddingLeft:"40px"}}/>


        <List />
      </div>
    );
  }
}

export default App;
